#pragma once - нестандартная директива препроцессора, которая, однако, поддерживается всеми основными компиляторами.
#pragma once указывает препроцессору, что заданный файл нужно подключать только один раз на одну единицу трансляции.
Это значит, что если какой-то файл с данной директивой (указывается в начале файла) был подключен в текущей единице трансляции, то его содержимое не будет копироваться еще раз. Еще раз об этом будет сказано во время знакомства с понятием include guards.
Ex. // файл a.h без #pragma once
void foo();
// файл b.h
#include "a.h"
// файл a.cpp
#include "a.h"
#include "b.h"
// после препроцессора в единице трансляции
void foo();
void foo();
Ex. // то же самое после препроцессора, но в начале a.h было указано #pragma once
void foo(); // файл a.h с #pragma once уже был подключен в файле a.cpp,
//затем при инклюде файла b.h внутри подключается a.h, что
//приводит к двойному включению файла a.h, но благодаря
// #pragma once в файле a.cpp останется только одна копия
// файла a.h
